pragma solidity ^0.4.18;

contract Signed {
    
  address[3] signers=[ 0x61127d6a05923f8e20f5ab5c2574426ac366d67e,0xed3f196c4d31b5ca135f42e9ca69906cdc0e7fa5,0xfb6d65ae169cb92a184fe6c1dba96b7733b02e50];
       
       
        
    address public creator=msg.sender;

  modifier onlySigner {
    require(msg.sender == signers[0] || msg.sender == signers[1] || msg.sender == signers[2]);
    _;
  }

}
